// Default imports
import React, {Component} from 'react';

// Custom imports
import './home.scss';
import {NavLink} from "react-router-dom";

import {connect} from 'react-redux';
import * as personalInfo from '../../actions/personalinfo';

class Home extends Component {
    componentDidMount() {
        const fullName = this.props.personalInfo.firstName + ' ' + this.props.personalInfo.lastName;
    }

    render() {
        return (
            // HTML here
            <div className='bg'>
                <div className="contentCenter">
                    <div className='fontSize'>
                        Hey, I'm <b>{fullName}</b>.<br/>
                        I'm a full-stack web developer.
                    </div>
                    <br/>
                    <NavLink to='/about' className="waves-effect waves-light btn-flat white"
                             onClick={this.props.GetPersonalInfo}>
                        Find out more.
                    </NavLink>
                </div>
            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return state
};

// Default export
export default connect(mapStateToProps, personalInfo)(Home);
